    background-color: transparent;
}
html[hide-scrollbar="true"]::-webkit-scrollbar {
    display: none;
}
::-webkit-scrollbar {
    width: 10px;
    height: 10px;
}
::-webkit-scrollbar-thumb {
    -webkit-appearance: none;
    background: #fff2;
    border: none;
    border-radius: 10px;
    box-shadow: none;
    width: 10px;
    height: 10px;
}
::-webkit-scrollbar-thumb:hover {
    -webkit-appearance: none;
    background: #fff3;
}
::-webkit-scrollbar-thumb:active {
    -webkit-appearance: none;
    background: #fff4;
}
::-webkit-scrollbar-track {
    -webkit-appearance: none;
    background: transparent;
    border-radius: 0;
    box-shadow: none;
    width: 10px;
    height: 10px;
}
::-webkit-scrollbar-track:vertical {
    -webkit-appearance: none;
    border-left: none;
    border-right: none;
    border-top: none;
    border-bottom: none;
}
::-webkit-scrollbar-track:horizontal {
    -webkit-appearance: none;
    border-top: none;
    border-bottom: none;
    border-left: none;
    border-right: none;
}
::-webkit-scrollbar-track-piece {
    -webkit-appearance: none;
    background: transparent;
    border: none;
    box-shadow: none;
    width: 10px;
    height: 10px;
}
::-webkit-scrollbar-corner {
    -webkit-appearance: none;
    background: transparent;
    border: none;
    border-radius: 10px;
    box-shadow: none;
}
